mie picture](https://cdn.discordapp.com/attachments/1030158179310506095/1035425841728983130/Elf.jpg){:height 497, :width 361}\\n\\nHår: Langt brunt som er krøllet ned til skuldrene\\nØjne: Grønne som mørk emerald\\nSkin: Lys brunt, glat og velholdt med et enkelt ar på højre inderlår på 2 cm.\\n\\nAmie voksede op i skovene blandt andre elvere og hendes folk og havde en normal barndom, hvert år når man fylder 18 så som mange andre skal man deltage i begivenheden \\logseq____&quot;Allocate\\logseq____&quot; som finder sted hvert år.\\nEn af byens ældre vælger ud fra opvækst og opførsel et individ som skal allokeres som betyder man skal ud på en rejse med en af de voksne mentorer.\\n\\nDette år blev Amie valgt og skulle have [[Osty]] som mentor.\\nDe tog op mod bjergene og årene gik.\\n\\nAmie fik sit første sjæle-bånd, til et flyveegern som fik navnet [[Oliver]] \\nOliver blev brugt til at holde kontakten til Amielogseq____&apos;s forældre imens hun blev allokeret.\\nDa Amie fylder 20 år er hun nu færdig med sin allokering og en del er sket på de bare 2 år.\\n\\nAmie brugte et år efterfølgende på at være spion og var dygtig til det.\\nDer var ikke nogen som endnu har opdaget eller fundet ud af at Amie er spion.\\nOliver bringer ordre tilbage til Amie og svaret bliver returneret via Oliver. Underligt nok kom Oliver altid tilbage med en eller anden form for mad/snack\\nDe er det perfekte makkerpar.\\n\\nEn dag beslutter hun sig for at blive en del af det brændende svær i håb om at finde ud af hvorfor [[Osty]] forsvandt - ingen ved hvordan dette kommer til at ende.logseq____&quot;,536870955]],[logseq____&quot;^15logseq____&quot;,[702,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870955]],[logseq____&quot;^15logseq____&quot;,[702,logseq____&quot;^Flogseq____&quot;,703,536870955]],[logseq____&quot;^15logseq____&quot;,[702,logseq____&quot;^Xlogseq____&quot;,24,536870955]],[logseq____&quot;^15logseq____&quot;,[702,logseq____&quot;^Vlogseq____&quot; ed at holde øje med mennesker og hvad de lavede og hvis de havde hemmelige møder i skoven.\\nPengene tjente han ved at få opgaver om at skaffe information af en fra det lokale marked.\\nEfter at have overvåget en del karavaner og set vagter beskytte dem besluttede han at han også kunne klare det job, og at det ville give ham en chance for at komme ud i verdenen.\\nSom lejesvend/vagt lærte han våbenkunst og klarede sig godt ved at vide hvordan man undgår at blive overvåget og forfulgt.\\n\\nFor nyligt har han besluttet sig for at det er irrelevant at være vagt for han kan kun beskytte ting så længe han er der, og så snart han er væk kan alting gå galt alligevel. Uanset hvor mange banditter han slår ihjel kommer der bare flere så længe lederen som sidder hjemme i skjulet stadig er i live. \\nDerfor har han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536870989]],[logseq____&quot;^15logseq____&quot;,[936,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870989]],[logseq____&quot;^15logseq____&quot;,[936,logseq____&quot;^Flogseq____&quot;,937,536870989]],[logseq____&quot;^15logseq____&quot;,[936,logseq____&quot;^Xlogseq____&quot;,23,536870989]],[logseq____&quot;^15logseq____&quot;,[936,logseq____&quot;^Vlogseq____&quot;,23,536870989]],[logseq____&quot;^15logseq____&quot;,[936,logseq____&quot;^Ulogseq____&quot;,23,536870989]],[logseq____&quot;^15logseq____&quot;,[936,logseq____&quot;^Ulogseq____&quot;,927,536870989]],[logseq____&quot;^15logseq____&quot;,[936,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3?logseq____&quot;,3],536870989]],[logseq____&q       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
